import Link from "next/link";
const NavBar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      * {
        font-family: tahoma;
      }
      ul {
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;
      }
      ul li {
        font-size: 18px;
        margin-right: 20px;
        padding: 1rem;
      }
      ul li a {
        color: #fff;
        text-decoration: none;
      }
      ul li:hover {
        background-color: grey;
        color: black;
      }
    `}</style>
  </div>
);
export default NavBar;
